// client/src/pages/MyBooksPage.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { toast } from 'react-toastify';
import { useAuth } from '../contexts/AuthContext';
// import { Link } from 'react-router-dom'; // For edit/delete links later

function MyBooksPage() {
    const { token } = useAuth();
    const [myBooks, setMyBooks] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    // Function to fetch books (can be reused for refresh after delete)
    const fetchMyBooks = async () => {
        try {
            setLoading(true);
            const config = {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            };
            const { data } = await axios.get('/api/books/mybooks', config);
            setMyBooks(data);
            setLoading(false);
        } catch (err) {
            console.error('Error fetching my books:', err);
            setError('Failed to load your books. Please try again later.');
            toast.error('Failed to load your books.');
            setLoading(false);
        }
    };

    useEffect(() => {
        if (token) { // Only fetch if token exists (user is logged in)
            fetchMyBooks();
        }
    }, [token]); // Rerun if token changes (e.g., user logs in/out)

    const handleDelete = async (bookId) => {
        if (window.confirm('Are you sure you want to delete this book?')) {
            try {
                const config = {
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                };
                await axios.delete(`/api/books/${bookId}`, config);
                toast.success('Book deleted successfully!');
                fetchMyBooks(); // Refresh the list after deletion
            } catch (error) {
                const errorMessage = error.response && error.response.data.message
                    ? error.response.data.message
                    : error.message;
                toast.error(`Failed to delete book: ${errorMessage}`);
                console.error('Error deleting book:', error);
            }
        }
    };

    if (loading) {
        return <div>Loading your books...</div>;
    }

    if (error) {
        return <div style={{ color: 'red' }}>Error: {error}</div>;
    }

    return (
        <div>
            <h1>My Listed Books</h1>
            {myBooks.length === 0 ? (
                <p>You haven't listed any books yet. <a href="/books/add">Add your first book!</a></p>
            ) : (
                <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))', gap: '20px' }}>
                    {myBooks.map((book) => (
                        <div key={book._id} style={{ border: '1px solid #ddd', padding: '15px', borderRadius: '8px', boxShadow: '2px 2px 8px rgba(0,0,0,0.1)' }}>
                            <img src={book.imageUrl} alt={book.title} style={{ width: '100%', height: '200px', objectFit: 'cover', borderRadius: '4px', marginBottom: '10px' }} />
                            <h3>{book.title}</h3>
                            <p><strong>Author:</strong> {book.author}</p>
                            <p><strong>Condition:</strong> {book.condition}</p>
                            <p><strong>Status:</strong> {book.availabilityStatus}</p>
                            <p style={{ fontSize: '0.9em', color: '#666' }}>{book.description.substring(0, 100)}{book.description.length > 100 ? '...' : ''}</p>
                            <div style={{ marginTop: '10px', display: 'flex', gap: '10px' }}>
                                {/* Link to Edit Page (to be implemented later) */}
                                {/* <Link to={`/my-books/edit/${book._id}`} style={{ padding: '8px 12px', background: '#28a745', color: 'white', textDecoration: 'none', borderRadius: '5px' }}>Edit</Link> */}
                                <button
                                    onClick={() => handleDelete(book._id)}
                                    style={{ padding: '8px 12px', background: '#dc3545', color: 'white', border: 'none', borderRadius: '5px', cursor: 'pointer' }}
                                >
                                    Delete
                                </button>
                            </div>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
}

export default MyBooksPage;
